CREATE DATABASE NoticiasInfile;
GO

USE NoticiasInfile;
GO

CREATE TABLE Categoria(
id INT IDENTITY(1,1) primary key,
categoria NVARCHAR(100) not null
);

CREATE TABLE Autor(
id INT IDENTITY(1,1) primary key,
nombre NVARCHAR(200) not null,
foto TEXT not null
);

CREATE TABLE Noticia (
    Id_noticia INT IDENTITY(1,1) PRIMARY KEY,
    Titulo NVARCHAR(200) NOT NULL,
    Cuerpo NVARCHAR(MAX) NOT NULL,
    FechaPublicacion DATE NOT NULL,
    FotoNoticia TEXT NOT NULL,
    IdAutor INT NOT NULL,
    IdCategoria INT NOT NULL,
    FOREIGN KEY (IdAutor) REFERENCES Autor(Id),
    FOREIGN KEY (IdCategoria) REFERENCES Categoria(Id)
);

CREATE TABLE Clientes (
    Id INT IDENTITY(1,1) PRIMARY KEY,
    Nombres NVARCHAR(100) NOT NULL,
    Apellidos NVARCHAR(100) NOT NULL,
    Edad INT NOT NULL,
    FechaNacimiento DATE NOT NULL,
    Token NVARCHAR(255) NOT NULL,
    Correo NVARCHAR(255) NOT NULL,
    Password NVARCHAR(255) NOT NULL
);

-- Procedimientos almacenados

-- Insertar Categoria

CREATE PROCEDURE InsertarCategoria
    @Categoria NVARCHAR(100)
AS
BEGIN
    INSERT INTO Categoria (Categoria)
    VALUES (@Categoria);
END;
GO

-- Insertar en Autor
CREATE PROCEDURE InsertarAutor
    @Nombre NVARCHAR(100),
    @Foto TEXT
AS
BEGIN
    INSERT INTO Autor (Nombre, Foto)
    VALUES (@Nombre, @Foto);
END;
GO

-- Insertar en Noticia
CREATE PROCEDURE InsertarNoticia
    @Titulo NVARCHAR(200),
    @Cuerpo NVARCHAR(MAX),
    @FechaPublicacion DATE,
    @FotoNoticia TEXT,
    @IdAutor INT,
    @IdCategoria INT
AS
BEGIN
    INSERT INTO Noticia (Titulo, Cuerpo, FechaPublicacion, FotoNoticia, IdAutor, IdCategoria)
    VALUES (@Titulo, @Cuerpo, @FechaPublicacion, @FotoNoticia, @IdAutor, @IdCategoria);
END;
GO

-- Insertar en Clientes
CREATE PROCEDURE InsertarCliente
    @Nombres NVARCHAR(100),
    @Apellidos NVARCHAR(100),
    @Edad INT,
    @FechaNacimiento DATE,
    @Token NVARCHAR(255),
    @Correo NVARCHAR(255),
    @Password NVARCHAR(255)
AS
BEGIN
    INSERT INTO Clientes (Nombres, Apellidos, Edad, FechaNacimiento, Token, Correo, Password)
    VALUES (@Nombres, @Apellidos, @Edad, @FechaNacimiento, @Token, @Correo, @Password);
END;
GO

