CREATE PROCEDURE MostrarCategorias
AS
BEGIN
    SELECT * FROM Categoria;
END;
GO


-- obtener autores
CREATE PROCEDURE MostrarAutores
AS
BEGIN
	SELECT * FROM Autor;
END;
GO

-- obtener clientes
CREATE PROCEDURE MostrarClientes
AS
BEGIN
	SELECT * FROM Clientes;
END;
GO


-- procedimiento almacenado para el logueo

CREATE PROCEDURE VerificarUsuario
    @Correo NVARCHAR(255),
    @Password NVARCHAR(255)
AS
BEGIN
    IF EXISTS (
        SELECT 1
        FROM Clientes
        WHERE Correo = @Correo AND Password = @Password
    )
    BEGIN
        SELECT 1 AS Resultado; 
    END
    ELSE
    BEGIN
        SELECT 0 AS Resultado; 
    END
END;
GO

-- Mostrar todas las noticias

CREATE PROCEDURE ObtenerNoticiasConDetalles
AS
BEGIN
    SELECT 
        n.Id_noticia ,
        n.Titulo ,
        n.Cuerpo ,
        n.FechaPublicacion,
        n.FotoNoticia,
        a.Id as IdAutor ,
        a.Nombre ,
        a.Foto ,
        c.Id as IdCategoria ,
        c.Categoria
    FROM 
        Noticia n
    INNER JOIN 
        Autor a ON n.IdAutor = a.Id
    INNER JOIN 
        Categoria c ON n.IdCategoria = c.Id
END;
GO

-- Mostrar noticias segun categoria

CREATE PROCEDURE ObtenerNoticiasPorCategoria
    @CategoriaId INT
AS
BEGIN
    SELECT 
        n.Id_noticia ,
        n.Titulo  ,
        n.Cuerpo ,
        n.FechaPublicacion,
        n.FotoNoticia,
        a.Id as IdAutor ,
        a.Nombre ,
        a.Foto,
        c.Id as IdCategoria ,
        c.Categoria
    FROM 
        Noticia n
    INNER JOIN 
        Autor a ON n.IdAutor = a.Id
    INNER JOIN 
        Categoria c ON n.IdCategoria = c.Id
    WHERE 
        n.IdCategoria = @CategoriaId;
END;
GO

drop procedure ObtenerNoticiasPorCategoria;


exec ObtenerNoticiasConDetalles;
EXEC ObtenerNoticiasPorCategoria @CategoriaId = 1 ;

